  TooltipSvg: React.lazy(() => import('../Icons/TooltipSvg')),
  UndeterminateSvg: React.lazy(() => import('../Icons/UndeterminateSvg')),
  UploadSvg: React.lazy(() => import('../Icons/UploadSvg')),
  VolumeOffSvg: React.lazy(() => import('../Icons/VolumeOffSvg')),
